import React, {useContext, useEffect, useState} from 'react';
import {Badge, ListGroup, Button} from "react-bootstrap";
import {Context} from "../index";

const OrderItem = ({orderCur}) => {


    return (
        <div className="p-2 m-1 d-flex ">

                <ListGroup >
                    <ListGroup.Item className="d-flex " style={{width:700, height:70 }}  variant="info">
                        <div className="d-flex flex-column justify-content-between">
                            <div className="d-flex justify-content-between" style={{fontSize:20}}>
                                <div>
                                    {orderCur.client_name}

                                </div>
                                <div>
                                   До: {orderCur.date_to_send}
                                </div>
                            </div>
                            <div className="d-flex justify-content-between" style={{color:"grey", width:660}}>
                                <div>
                                    {orderCur.city}
                                </div>
                                <div className="d-flex">
                                    <div style={{minWidth:90}}>
                                        {orderCur.status}
                                    </div>
                                    <div style={{minWidth:180}}>

                                        {orderCur.payment_status}
                                    </div>

                                </div>
                            </div>


                        </div>

                    </ListGroup.Item>

                </ListGroup>

        </div>
    );
};

export default OrderItem;
